import React, { Fragment } from 'react';
import './App.css';

const App =  () => {
  return (
    <Fragment>
      <h1>App</h1>
      <h2>Image by <a href="https://pixabay.com/users/www_slon_pics-5203613/?utm_source=link-attribution&amp;utm_medium=referral&amp;utm_campaign=image&amp;utm_content=2261021">www_slon_pics</a> from <a href="https://pixabay.com/?utm_source=link-attribution&amp;utm_medium=referral&amp;utm_campaign=image&amp;utm_content=2261021">Pixabay</a></h2>
    </Fragment>
  );
}

export default App;
